        <div onClick={()=>{display==='none'?set_display('block'):set_display('none')}} style={{display:'block',position:'fixed',zIndex:10000,top:0,fontSize:'small',height:'100vh',}}>
        <FileViewer fileType='docx'
                    filePath={require('/Users/admin/Downloads/code/dajia/frontend/src/static/demo.docx')}
                    />
    </div>
    )
}
export default Word_preview;
